'use strict';let buttonAdded=!1;
function addButton(c){if(!buttonAdded){var a=document.createElement("button");a.innerText="Add it to Wikimedia Commons!";a.style.marginLeft="10px";a.style.backgroundColor="blue";a.style.color="white";a.style.border="none";a.style.padding="5px 10px";a.style.borderRadius="5px";a.style.cursor="pointer";a.onclick=function(){const b=window.location.pathname.split("/").pop();window.open(`https://inat2wiki.toolforge.org/parse/${b}`,"_blank")};c.appendChild(a);buttonAdded=!0}}
function observeDOMChanges(){const c=new MutationObserver(a=>{a.forEach(b=>{!buttonAdded&&b.addedNodes.length&&(b=document.querySelector(".ObservationTitle"))&&(addButton(b),c.disconnect())})});c.observe(document.body,{childList:!0,subtree:!0})}observeDOMChanges();